import './Header.css';
const Header = () => {
    return (
      <header className="App-header">
        <div className='logo'>
          {/* <img className='p-logo' src=''/> to be here*/}
          <button className="btn-mode" onClick={".light"}>Dark Mode</button>
        </div>
        <div className='menu_container'>
          <button ><div className='about_me' id='#about_me_div'> About me</div></button>
          <button id='#my_projects_div'><div className='my_projects' id='my_projects'>Projects</div></button>
          <button id='#contact_me_div'><div className='contact_me' id='#contact_me'>Contact me</div></button>
        </div>
    </header>
    );
}
 
export default Header;
